<p>Violins produced on the island of Grxcd have become collectors’ items since it sank into the sea two centuries ago. All the island’s violins were produced by Bropcs or one of his sons, or by Czwyz or one of his sons. Every violin was labelled ostensibly to reveal its maker but, although Bropcs and his sons always labelled their violins truthfully, Czwyz and his sons always labelled their violins with falsehoods. Both families playfully interfered with collectors’ attempts to establish provenances for their violins. For example, collectors figured out that a violin labelled “ This violin was not made by any son of Bropcs.” was made by Bropcs Sr.; can you see why? The most desirable violins are so labelled that a connoisseur can tell that it must have been made by one of the fathers, either Bropcs Sr. or Czwyz Sr., but cannot tell which. How might such a violin be labelled?</p>
